import React from 'react';

export default function BtnFlat({children}) {

    return(
        <>
            <button type="button" class="bg-darkGray text-white py-2 px-4 rounded-full font-bold text-lg flex gap-2 items-center justify-center w-full hover:bg-[000000] transition-all ease-in">
                {children}
            </button>
        </>
    );
};
